2.1. Исполнитель вправе самостоятельно осуществлять образовательный процесс, выбирать системы оценок, формы, порядок и периодичность промежуточной  аттестации Потребителя, применять к нему меры поощрения и налагать взыскания в пределах, предусмотренных Уставом Исполнителя, а также в соответствии с локальными нормативными актами Исполнителя.
2.2. Заказчик вправе требовать от Исполнителя предоставления информации по вопросам организации и обеспечения надлежащего исполнения услуг, предусмотренных разделом 1 настоящего договора.
2.3. Заказчик вправе получать информацию об успеваемости, поведении, отношении Потребителя к учебе в целом и по отдельным предметам учебного плана.
2.4. Потребитель вправе:
обращаться к работникам Исполнителя по вопросам, касающимся процесса обучения в образовательном учреждении;
получать полную и достоверную информацию об оценке своих знаний, умений и навыков, а также о критериях этой оценки;
пользоваться имуществом Исполнителя, необходимым для осуществления образовательного процесса, во время занятий, предусмотренных расписанием;
пользоваться дополнительными образовательными услугами, предоставляемыми Исполнителем и не входящими в учебную программу, на основании отдельно заключенного договора;

1.1.1. Обеспечивать круглосуточный выезд эвакуатора;
1.1.2. Обеспечивать эвакуацию ТС до места, указанного Заказчиком;
1.1.3. Осуществлять выгрузку ТС с эвакуатора в месте, указанном Заказчиком, в присутствии представителя последнего;
1.1.4. Нести ответственность за сохранность транспортного средства Заказчика, с момента принятия его к перевозке;
1.1.5. Информировать Заказчика об изменении тарифов на услуги Исполнителя в письменном виде не позднее, чем за 30 (тридцать) дней до введения в действие новых тарифов;

   2.2.1. Предоставить Исполнителю списки автомобилей Заказчика,  и технические характеристики                                                                           транспортных средств;
   2.2.2. При изменении данных, содержащихся в вышеуказанных списках, не позднее чем за 2 (два) рабочих дня извещать об                     этом исполнителя;
  2.2.3.  При заказе эвакуатора необходимо:
- сообщить Исполнителю технические характеристики транспортного средства (вес, габариты);
- предъявить представителю Исполнителя (водителю эвакуатора) документы на транспортное средство;
- уполномочить своего представителя присутствовать при погрузке и выгрузке транспортного средства с эвакуатора. Стороны договорились, что по умолчанию представителем Заказчика является водитель;
   2.2.4.  Заказчик обязуется оплатить Исполнителю услуги по настоящему договору в порядке и сроки, указанные в п.п. 4.1. – 4.5. настоящего договора, в соответствии с Тарифами на оказание услуг по перемещению (эвакуации) ТС (Приложение № 1), являющимися неотъемлемой частью настоящего договора.

