•хранение и    складирование   газа   и   продуктов   его переработки;
•хранение и  складирование прочих жидких или газообразных грузов;
•прочая вспомогательная транспортная деятельность;
•подготовка к  продаже,  покупка  и  продажа собственного недвижимого имущества;
•подготовка к продаже собственного недвижимого имущества;
•покупка и продажа земельных участков;
•аренда прочего автомобильного транспорта и оборудования;
•аренда прочих машин и оборудования;
