СТАТЬЯ 3. УСТАВНЫЙ КАПИТАЛ.
0.1. Уставный капитал Общества составляется из номинальной стоимости долей его Участников. Размер Уставного капитала Общества составляет 1000000  (Один миллион) рублей.
0.2. Оплата долей в уставном капитале Общества может осуществляться денежными средствами, вещами, долями (акциями) в уставных (складочных) капиталах других хозяйственных товариществ и обществ, государственными и муниципальными облигациями, подлежащими денежной оценке исключительными, иными интеллектуальными правами и правами по лицензионным договорам, а также, если это не запрещено законодательством, иным имуществом и имущественными правами.
0.2. Общество вправе, а в случаях, предусмотренных Законом, обязано уменьшить уставный капитал. Уменьшение уставного капитала может осуществляться путем уменьшения номинальной стоимости долей всех Участников Общества в уставном капитале Общества и (или) погашения долей, принадлежащих Обществу.
0.3. Увеличение уставного капитала Общества может осуществляться за счет имущества Общества, и (или) за счет дополнительных вкладов Участников Общества, и (или) за счет вкладов третьих лиц, принимаемых в Общество.

СТАТЬЯ 4. ПЕРЕХОД ДОЛИ ИЛИ ЧАСТИ ДОЛИ УЧАСТНИКА.
0.1. Участник Общества вправе продать или осуществить отчуждение иным образом своей доли в уставном капитале Общества либо ее части одному или нескольким Участникам Общества. Согласие Общества или других Участников Общества на совершение такой сделки не требуется.
0.2. Участник Общества вправе продать или осуществить отчуждение иным образом своей доли (части доли) в уставном капитале Общества третьим лицам.
0.3. Доля Участника Общества может быть отчуждена до полной ее оплаты только в части, в которой она оплачена.
0.4. Участники Общества пользуются преимущественным правом покупки доли (части доли) Участника Общества по цене предложения третьему лицу пропорционально размерам своих долей.
4.5. Участник Общества, намеренный продать свою долю или часть доли в уставном капитале Общества третьему лицу, обязан известить в письменной форме об этом остальных Участников Общества и само Общество путем направления через Общество за свой счет нотариально удостоверенной оферты, адресованной этим лицам и содержащей указание цены и других условий продажи. Оферта о продаже доли или части доли в уставном капитале Общества считается полученной всеми Участниками Общества в момент ее получения Обществом. При этом она может быть акцептована лицом, являющимся Участником Общества на момент акцепта. Оферта считается неполученной, если в срок не позднее дня ее получения Обществом Участнику Общества поступило извещение о ее отзыве. Полученная Обществом оферта может быть отозвана Участником, направившим ее, в течение срока, установленного для ее акцепта, путем направления Участникам Общества через Общество уведомления об отзыве оферты.
Участники Общества вправе воспользоваться преимущественным правом покупки доли или части доли в уставном капитале Общества в течение тридцати дней с даты получения оферты Обществом. 
При отказе отдельных Участников Общества от использования преимущественного права покупки доли или части доли в уставном капитале Общества другие Участники Общества могут реализовать преимущественное право покупки доли или части доли в уставном капитале Общества в соответствующей части пропорционально размерам своих долей в пределах оставшейся части срока реализации ими преимущественного права покупки доли или части доли.
4.6. Преимущественное право покупки доли или части доли в уставном капитале Общества у Участника прекращается в день:
представления составленного в письменной форме заявления об отказе от использования данного преимущественного права;
истечения срока использования данного преимущественного права.
Заявления Участников Общества об отказе от использования преимущественного права покупки доли или части доли должны поступить в Общество до истечения срока осуществления указанного преимущественного права.
4.7. В случае, если в течение тридцати дней с даты получения оферты Обществом, Участники Общества не воспользуются преимущественным правом покупки доли или части доли в уставном капитале Общества, предлагаемых для продажи, в том числе образующихся в результате отказа отдельных Участников Общества от преимущественного права покупки доли или части доли в уставном капитале Общества, оставшиеся доля или часть доли могут быть проданы третьему лицу по цене, которая не ниже установленной в оферте для Общества и его Участников цены, и на условиях, которые были сообщены Обществу и его Участникам. 
4.8. Переход доли в уставном капитале Общества к наследникам граждан и правопреемникам юридических лиц, являвшихся Участниками Общества, передача доли, принадлежавшей ликвидированному юридическому лицу, его учредителям (участникам), имеющим вещные права на его имущество или обязательственные права в отношении этого юридического лица, допускаются только с согласия остальных Участников Общества. 
4.9. При продаже доли или части доли в уставном капитале Общества с публичных торгов права и обязанности Участника Общества по такой доле или части доли переходят с согласия Участников Общества.

СТАТЬЯ 5. ВЫХОД УЧАСТНИКА ОБЩЕСТВА ИЗ ОБЩЕСТВА.
0.1. Участник Общества вправе выйти из Общества независимо от согласия других Участников или самого Общества путем:
– подачи заявления о выходе из Общества (такое заявление Участника должно быть нотариально удостоверено);
- предъявления к Обществу требования о приобретении Обществом доли в случаях, предусмотренным законодательством.
0.2. В случае выхода Участника Общества из Общества его доля переходит к Обществу с момента получения Обществом соответствующего заявления или требования. Этому Участнику должна быть выплачена действительная стоимость его доли в уставном капитале Общества, определяемая на основании данных бухгалтерской отчетности Общества за последний отчетный период, предшествующий дню подачи таким Участником соответствующего заявления или требования, либо с согласия этого Участника Общества должно быть выдано в натуре имущество такой же стоимости. Общество обязано выплатить Участнику Общества действительную стоимость его доли в уставном капитале Общества либо выдать ему в натуре имущество такой же стоимости в течение трех месяцев со дня перехода доли к Обществу.

СТАТЬЯ 6. УСЛОВИЯ И ПОРЯДОК РАСПРЕДЕЛЕНИЯ ПРИБЫЛИ МЕЖДУ УЧАСТНИКАМИ ОБЩЕСТВА.
0.1. Общество вправе ежеквартально, раз в полгода или раз в год принимать решение о распределении своей чистой прибыли между Участниками Общества. Решение об определении части прибыли Общества, распределяемой между Участниками Общества, принимается Общим собранием Участников Общества.
Порядок и срок выплаты части распределенной прибыли Общества определяются решением Общего собрания Участников Общества о распределении прибыли между ними. Срок выплаты части распределенной прибыли Общества не может превышать сроков, установленных законодательством.
В случае если в течение срока выплаты части распределенной прибыли Общества, часть распределенной прибыли не выплачена Участнику Общества, он вправе обратится в течение трех лет после истечения указанного срока к Обществу с требованием о выплате соответствующей части прибыли.
0.2. Решением Общего собрания Участников, принятым всеми Участниками Общества единогласно, может быть предусмотрено распределение прибыли между Участниками Общества не пропорционально их долям в уставном капитале Общества. 
0.3. Общество не вправе принимать решение о распределении своей прибыли между Участниками Общества:
до полной оплаты всего уставного капитала Общества;
до выплаты действительной стоимости доли или части доли Участника Общества в случаях, предусмотренных Законом;
если на момент принятия такого решения Общество отвечает признакам несостоятельности (банкротства) в соответствии с федеральным законом о несостоятельности (банкротстве) или если указанные признаки появятся у Общества в результате принятия такого решения;
если на момент принятия такого решения стоимость чистых активов Общества меньше его уставного капитала и резервного фонда или станет меньше их размера в результате принятия такого решения;
в иных случаях, предусмотренных федеральными законами.
6.4. Общество не вправе выплачивать Участникам Общества прибыль, решение о распределении которой между Участниками Общества принято:
если на момент выплаты Общество отвечает признакам несостоятельности (банкротства) в соответствии с федеральным законом о несостоятельности (банкротстве) или если указанные признаки появятся у Общества в результате выплаты;
если на момент выплаты стоимость чистых активов Общества меньше его уставного капитала и резервного фонда или станет меньше их размера в результате выплаты;
в иных случаях, предусмотренных федеральными законами.
По прекращении указанных в настоящем пункте обстоятельств Общество обязано выплатить Участникам Общества прибыль, решение о распределении которой между Участниками Общества принято.

СТАТЬЯ 7. ПРАВА И ОБЯЗАННОСТИ УЧАСТНИКОВ ОБЩЕСТВА.
0.1    Участники Общества вправе:
•участвовать в управлении делами Общества в порядке, установленном законодательством и Уставом Общества;
•получать информацию о деятельности Общества и знакомиться с его бухгалтерской и иной документацией в порядке, установленном Уставом Общества;
•принимать участие в распределении прибыли;
•продать или осуществить отчуждение иным образом своей доли или части доли в уставном капитале Общества одному или нескольким Участникам Общества либо другому лицу в порядке, предусмотренном Законом и Уставом Общества;
•требовать исключения другого Участника Общества в случаях и в порядке, предусмотренных действующим законодательством;
•выйти из Общества;
•получить в случае ликвидации Общества часть имущества, оставшегося после расчетов с кредиторами, или его стоимость.
Участники Общества имеют также иные права, предусмотренные законодательством и Уставом Общества.
0.2. Участники Общества обязаны:
•оплачивать доли в уставном капитале Общества в порядке, способом, в размерах и в сроки, которые предусмотрены Законом;
•по решению Общего собрания Участников Общества вносить вклады в имущество Общества;
•не разглашать конфиденциальную информацию о деятельности Общества;
•участвовать в принятии корпоративных решений, без которых Общество не может продолжать свою деятельность, если участие Участников необходимо для принятия таких решений;
•не совершать действия, заведомо направленные на причинение вреда Обществу;
•не совершать действия (бездействия), которые существенно затрудняют или делают невозможным достижение целей, ради которых создано Общество;
Участники Общества несут также иные обязанности, предусмотренные законодательством и Уставом Общества.
7.3. В случае принятия Общим собранием Участников решения о внесении вкладов в имущество Общества Участники Общества обязаны внести вклады в размере и в сроки, определенные решением Общего собрания Участников. При этом решением Общего собрания Участников, принятым всеми Участниками Общества единогласно, может быть предусмотрено внесение Участниками вкладов в имущество Общества не пропорционально их долям в уставном капитале. Вклады в имущество могут быть внесены денежными средствами, а также другим имуществом или правами, имеющими денежную оценку, в соответствии с решением Общего собрания Участников.

СТАТЬЯ 8. ОРГАНЫ УПРАВЛЕНИЯ.
0.1. Органами управления Общества являются:
•Общее собрание участников – высший орган Общества;
•Совет директоров – коллегиальный орган управления;
•Генеральный директор - единоличный исполнительный орган. Полномочия единоличного исполнительного органа выступать от имени Общества могут быть предоставлены нескольким лицам, действующим совместно или независимо друг от друга. 

СТАТЬЯ 9. ОБЩЕЕ СОБРАНИЕ УЧАСТНИКОВ.
0.1. Высшим органом управления Общества является Общее собрание Участников.
0.2. Ежегодно не ранее чем через 2 месяца и не позднее чем через 4 месяца после окончания финансового года, который устанавливается с 1 января по 31 декабря, проводится очередное Общее собрание Участников Общества, созываемое Генеральным директором Общества для утверждения годовых результатов деятельности Общества. Проводимые помимо очередного Общие собрания Участников являются внеочередными. Участники Общества вправе участвовать в Общем собрании лично или через своих представителей.
0.3. К компетенции Общего собрания Участников относятся:
1) определение приоритетных направлений деятельности Общества, принципов образования и использование его имущества, а также принятие решения об участии в ассоциациях и других объединениях коммерческих организаций;
2) утверждение Устава Общества, внесение в него изменений или утверждение Устава в новой редакции, принятие решения о том, что Общество в дальнейшем действует на основании типового устава, либо о том, что Общество в дальнейшем не будет действовать на основании типового устава; 
3) изменение размера уставного капитала Общества, если иное не предусмотрено законодательством, изменение наименования Общества, места нахождения Общества;
4) увеличение уставного капитала Общества непропорционально долям его Участников или за счет принятия третьего лица в состав Участников Общества;
5) принятие решения о передаче полномочий единоличного исполнительного органа Общества другому хозяйственному обществу (управляющей организации) или индивидуальному предпринимателю (управляющему), утверждение такой управляющей организации и такого управляющего и условий договора с ними;
6) определение порядка приема в состав Участников Общества и исключение из его числа Участников, кроме случаев, если такой порядок определен законодательством;
7) создание филиалов, открытие представительств Общества, утверждение положений о филиалах, представительствах Общества, внесение в них изменений, принятие решений о прекращении деятельности филиалов, закрытии представительств Общества;
8) утверждение годовых отчетов и бухгалтерской (финансовой) отчетности;
9) распределение прибылей и убытков Общества;
10) принятие решения о размещении Обществом облигаций и иных эмиссионных ценных бумаг;
11) назначение аудиторской проверки, утверждение аудитора и определение размера оплаты его услуг;
12) принятие решения о реорганизации или ликвидации Общества;
13) назначение ликвидационной комиссии (ликвидатора) и утверждение ликвидационного баланса;
14) определение денежной оценки неденежных вкладов в уставный капитал Общества;
15) распределение доли в уставном капитале Общества, принадлежащей Обществу в соответствии с законодательством;
16) принятие решения о выплате действительной стоимости доли кредиторам Участника, на имущество которого обращается взыскание;
17) принятие решения о внесении Участниками вкладов в имущество Общества;
18) принятие решения о совершении сделок, в совершении которых имеется заинтересованность, если сумма оплаты по сделке или стоимость имущества, являющегося предметом сделки, составляет более 2 процентов стоимости имущества Общества по данным бухгалтерской отчетности на последнюю отчетную дату;
19) принятие решения о совершении крупной сделки, связанной с приобретением, отчуждением или возможным отчуждением имущества, стоимость которого составляет 50 и более процентов стоимости имущества Общества по данным бухгалтерской отчетности на последнюю отчетную дату;
20) избрание ревизионной комиссии (ревизора) в случаях, когда ее образование является обязательным в соответствии с Законом;
21) утверждение внутренних документов Общества, регулирующих корпоративные отношения;
22) предоставление полномочий единоличного исполнительного органа Общества нескольким лицам, действующим совместно;
23) образование в Обществе нескольких единоличных исполнительных органов, действующих независимо друг от друга;
24)  избрание членов Совета директоров Общества, прекращение полномочий членов Совета директоров; принятие решения о страховании Обществом ответственности членов Совета директоров и/или Генерального директора Общества;установление членам Совета директоров Общества вознаграждения и (или) компенсации расходов, связанных с исполнением ими функций членов Совета директоров в период исполнения ими своих обязанностей, определение размеров таких вознаграждений и компенсаций;
25) принятие решений о совершении сделок (в том числе нескольких взаимосвязанных сделок) на сумму, превышающую 100000000 (сто миллионов) рублей (или эквивалент указанной суммы в любой другой валюте), и сделок (в том числе нескольких взаимосвязанных сделок) с имуществом Общества, стоимость которого на основании данных бухгалтерской отчетности Общества за последний отчетный период, предшествующий дню принятия решения о совершении таких сделок, превышает 100000000 (сто миллионов) рублей (или эквивалент указанной суммы в любой другой валюте), за исключением сделок, совершаемых в процессе обычной хозяйственной деятельности Общества, а также, за исключением сделок с ПАО «Газпром нефть» и обществами, входящими в группу лиц с ним когда такая сделка или несколько взаимосвязанных сделок является(-ются) сделкой, в совершении которой имеется заинтересованность);
26) решение иных вопросов, предусмотренных Законом и настоящим Уставом.
     Решение вопросов, указанных в пункт 9.3 настоящей статьи, относится к исключительной компетенции Общего собрания Участников Общества и не может быть передано на рассмотрение Совету директоров или Генеральному директору Общества, за исключением случаев, предусмотренных законодательством.
0.4. Внеочередное Общее собрание Участников созывается Генеральным директором Общества в случаях, предусмотренных Уставом Общества и иных случаях, если проведения такого Общего собрания Участников требуют интересы Общества и его Участников, а именно:
* по требованию Совета директоров;
* по инициативе Генерального директора;
* по требованию аудитора;
по требованию Участников, обладающих в совокупности не менее чем одной десятой от общего числа голосов Участников Общества.
0.5. Генеральный директор обязан в течение 5 дней с даты получения требования о проведении внеочередного Общего собрания Участников рассмотреть данное требование и принять решение о проведении внеочередного Общего собрания Участников Общества или об отказе в его проведении. Решение об отказе в проведении внеочередного Общего собрания Участников Общества может быть принято Генеральным директором только в случаях, предусмотренных Законом.
0.6. В случае принятия решения о проведении внеочередного Общего собрания Участников оно проводится не позднее 45 дней со дня получения требования о его проведении.
Если в течение 5 дней с даты получения требования о проведении внеочередного Общего собрания Участников не принято решение о его проведении или принято решение об отказе в его проведении, внеочередное Общее собрание Участников может быть созвано органами или лицами, требующими его проведения.
0.7. Общее собрание Участников Общества созывается посредством направления уведомления в адрес Участников органом или лицами, созывающими Общее собрание Участников Общества, заказным письмом или вручается им лично под роспись или направляется иным способом, позволяющем достоверно определить получение уведомления адресатом. Уведомление направляется по адресу, предоставленному Участником в Общество. Общество не несет ответственности за неполучение Участником уведомления в связи с недостоверностью адреса.
 В уведомлении указывается дата, время, место проведения и повестка дня Общего собрания Участников, адрес помещения для ознакомления с информацией и материалами, предоставляемыми Участникам. Уведомление должно быть направлено Участникам не позднее чем за 10 дней до даты проведения Общего собрания Участников. 
0.8. Любой Участник Общества вправе вносить предложения о включении в повестку дня Общего собрания Участников Общества дополнительных вопросов не позднее чем за 5 дней до его проведения.
0.9. В случае если по предложению Участников Общества в первоначальную повестку дня Общего собрания Участников Общества вносятся изменения, орган или лица, созывающие Общее собрание Участников, обязаны не позднее, чем за 3 дня до его проведения уведомить всех Участников Общества о внесенных в повестку дня изменениях способом, указанном в пункт 9.7 настоящего Устава.
0.10. К информации и материалам, подлежащим предоставлению Участникам Общества при подготовке Общего собрания Участников Общества, относятся годовой отчет Общества, сведения о кандидате (кандидатах) в Совет директоров Общества, проект изменений и дополнений, вносимых в Устав Общества, проекты внутренних документов Общества и иная информация в соответствии с требованиями законодательства.
Участники Общества и другие заинтересованные лица Общества в течение 5 дней до проведения Общего собрания Участников Общества могут ознакомиться с указанной информацией и материалами в помещении исполнительного органа Общества, адрес которого указывается в уведомлении о проведении Общего собрания Участников, рассылаемом Участникам Общества. По взаимному согласию между органом или лицами, созывающими Общее собрание Участников, и Участниками Общества и другими заинтересованными лицами Общества может быть установлен иной порядок предоставления информации и материалов.
0.11. В случае нарушения установленного настоящим Уставом и Законом порядка созыва Общего собрания Участников Общества такое Общее собрание признается правомочным, если в нем участвуют все Участники Общества.
0.12. Общее собрание Участников Общества проводится в порядке, установленном Законом, настоящим Уставом и внутренними документами Общества. В части, не урегулированной Законом, настоящим Уставом и внутренними документами Общества, порядок проведения Общего собрания Участников Общества устанавливается решением Общего собрания Участников.
0.13. Общее Собрание Участников Общества открывается Генеральным директором Общества.
 Общее Собрание Участников Общества, созванное Советом директоров Общества, аудитором или Участниками Общества, открывает председатель Совета директоров Общества, аудитор или один из Участников Общества, созвавших данное Общее собрание Участников.
Перед открытием Общего собрания Участников лицо, открывающее собрание, проводит регистрацию прибывших Участников Общества (их представителей), проверяет их полномочия, о чем вносит запись в Протокол Общего собрания Участников. 
0.14. Лицо, открывающее Общее собрание Участников, проводит выборы председательствующего на Общем собрании. Председательствующий избирается большинством голосов от общего числа голосов Участников Общества, принимающих участие в Общем собрании Участников, по принципу один Участник - один голос.
0.15. Генеральный директор Общества организует ведение протокола Общего собрания Участников.
0.16. Решение Общего собрания может быть принято путем проведения заочного голосования (опросным путем), за исключением решения по вопросам утверждения годовых отчетов и бухгалтерских балансов.
0.17. Участники обладают количеством голосов пропорционально размеру их долей в Уставном капитале Общества, за исключением случая, предусмотренного пункт 9.14 настоящего Устава.
0.18. Решения, принятые Общим собранием Участников Общества, обязательны для всех Участников Общества независимо от их присутствия.
0.19. Для принятия решений по вопросам, указанным в подпунктах 4), 13), 15), 17) пункт 9.3 настоящего Устава, требуется единогласие всех Участников Общества. Решение по вопросу, указанному в подпункте 19) пункт 9.3 настоящего Устава, принимается единогласно всеми Участниками Общества, не заинтересованными в совершении соответствующей сделки.
0.20. Решение по вопросу, указанному в подпунктах 2), 3), 8), 16), 18) пункт 9.3, принимается большинством не менее 2/3 голосов от общего числа голосов Участников Общества. 
  Решения по остальным вопросам принимаются простым большинством голосов от общего числа голосов Участников Общества, если необходимость большего числа голосов для принятия таких решений не предусмотрена Законом и настоящим Уставом.
0.21. За исключением случаев, когда Законом в обязательном порядке установлено иное, принятие Общим собранием Участников Общества решений и состав участников Общества, присутствовавших при принятии таких решений, подтверждаются путем подписания протокола Общего собрания Участников Участниками Общества, владеющими в совокупности более 50% голосов от общего числа голосов Участников Общества и принимавшими участие в данном Общем собрании. 
Во избежание сомнений, предусмотренный настоящим пункт 9.21 Устава порядок удостоверения решения считается надлежащим в соответствии с Гражданским кодексом РФ, и нотариальное удостоверение протокола не требуется.
  9.22. В Обществе, состоящем из одного Участника, решения по вопросам, относящимся к компетенции Общего собрания Участников, принимаются единственным Участником единолично. Принятие единственным Участником решений подтверждается его подписью на решении. 

СТАТЬЯ 10. СОВЕТ ДИРЕКТОРОВ ОБЩЕСТВА.
0.1. Совет директоров Общества осуществляет общее руководство деятельностью Общества, а также контроль за исполнением решений Общего собрания Участников Общества и иной деятельностью его исполнительного органа.
0.2. Персональный состав Совета директоров определяется решением Общего собрания Участников Общества. Каждый член Совета директоров имеет один голос. 
0.3. К компетенции Совета директоров относится:
1) утверждение годовых бюджетов, бизнес-планов, финансовых планов Общества, стратегий, программ развития и инвестиционных программ Общества, внесение изменений в указанные документы, рассмотрение промежуточных результатов и итогов их выполнения;
2) избрание Генерального директора Общества, досрочное прекращение его полномочий, установление размера вознаграждения и денежных компенсаций Генеральному директору и утверждение условий трудового договора с ним;
3) принятие решений о совершении Обществом крупных сделок, связанных с приобретением, отчуждением или возможностью отчуждения Обществом прямо или косвенно имущества, стоимость которого составляет от 25 до 50 процентов стоимости имущества Общества, определенной на основании данных бухгалтерской отчетности за последний отчетный период, за исключением случаев, когда в соответствии с положениями Устава принятие решения о совершении такой сделки относится к компетенции Общего собрания участников;
4) принятие решений о совершении Обществом сделок, в совершении которых имеется заинтересованность, если сумма оплаты по сделке или стоимость имущества, являющегося предметом сделки, не превышает 2 процентов стоимости имущества Общества, определенной на основании данных бухгалтерской отчетности за последний отчетный период;
5) принятие решений о совершении сделок (в том числе нескольких взаимосвязанных сделок) на сумму, превышающую 50000000 (пятьдесят миллионов) рублей (или эквивалент указанной суммы в любой другой валюте), и сделок (в том числе нескольких взаимосвязанных сделок) с имуществом Общества, стоимость которого на основании данных бухгалтерской отчетности Общества за последний отчетный период, предшествующий дню принятия решения о совершении таких сделок, превышает 50000000 (пятьдесят миллионов) рублей (или эквивалент указанной суммы в любой другой валюте), за исключением сделок, совершаемых в процессе обычной хозяйственной деятельности Общества, а также, за исключением сделок с ПАО «Газпром нефть» и обществами, входящими в группу лиц с ним;
6) принятие решений о совершении сделок, связанных с получением или предоставлением Обществом займов, кредитов (в том числе вексельных), предоставлением гарантий и поручительств по обязательствам Общества и(или) третьих лиц, за исключением сделок с ПАО «Газпром нефть» и обществами, входящими в группу лиц с ним;
7) принятие решений о совершении сделок, связанных с продажей, иным отчуждением или обременением недвижимого имущества, или о совершении сделки, связанной с возможностью отчуждения прямо или косвенно недвижимого имущества Общества, за исключением сделок с ПАО «Газпром нефть» и обществами, входящими в группу лиц с ним;
8) принятие решений о совершении сделок, связанных с передачей в аренду недвижимого имущества Общества, за исключением помещений и непрофильного имущества признанного таковым в соответствии с решением Совета директоров Общества, а также за исключением сделок с ПАО «Газпром нефть» и обществами, входящими в группу лиц с ним;
9) принятие решений о совершении сделок, связанных с приобретением или отчуждением долей в уставных капиталах, акций, облигаций, закладных, векселей или иных ценных бумаг или любых прав в отношении такого имущества (путем конвертации, подписки, опционов или иным способом) любой компании или другой организации, за исключением сделок с ПАО «Газпром нефть» и обществами, входящими в группу лиц с ним; принятие решений о совершении сделок, связанных с передачей в залог или установлением иных обременений в отношении принадлежащих Обществу долей в уставных капиталах или акций, за исключением сделок с ПАО «Газпром нефть» и обществами, входящими в группу лиц с ним;
10) принятие решений о создании Обществом других юридических лиц, об участии или прекращении участия Общества в других организациях;
11) принятие решений о совершении сделок мены, дарения, иных сделок, предусматривающих безвозмездное отчуждение имущества Общества либо оплату (встречное предоставление) в неденежной форме, за исключением сделок с ПАО «Газпром нефть» и обществами, входящими в группу лиц с ним;
12) принятие решений о заключении Обществом акционерных соглашений, соглашений об осуществлении прав участников (корпоративных договоров), опционных соглашений, договоров простого товарищества и иных соглашений о совместной деятельности, за исключением сделок с ПАО «Газпром нефть» и обществами, входящими в группу лиц с ним;
13) предварительное согласование решений Генерального директора о назначении заместителей Генерального директора Общества и Главного бухгалтера Общества;
14) предварительное определение позиции Общества при голосовании (принятии решений) по вопросам, относящимся к компетенции общего собрания акционеров (участников) хозяйственных обществ, акционером (участником) которых является Общество;
15) привлечение Генерального директора Общества к дисциплинарной ответственности;
16) назначение Секретаря Совета директоров Общества;
17) осуществление контроля за исполнением решений Общего собрания Участников Общества, иной деятельностью Генерального директора Общества, заслушивание отчетов Генерального директора в период между Общими собраниями Участников; утверждение (принятие) документов, регулирующих внутреннюю деятельность Общества (внутренних документов Общества), за исключением документов, регулирующих корпоративные отношения;
18) принятие решения о заключении Обществом мирового соглашения на сумму свыше денежной суммы, эквивалентной 50000000 (пятидесяти миллионам) рублей или эквивалента указанной суммы в любой другой валюте (либо предметом которого является имущество, стоимость которого превышает 50000000 (пятьдесят миллионов) рублей. 
0.4. Принятие решения о совершении сделки, которая согласно различным критериям, установленным настоящим Уставом, одновременно подлежит одобрению Советом директоров Общества и Общим собранием участников Общества, относится к исключительной компетенции Общего собрания участников Общества.
0.5. Члены Совета директоров Общества избираются Общим собранием Участников большинством голосов на срок до принятия Общим собранием Участников решения о прекращении их полномочий.
0.6. Полномочия любого члена (всех членов) Совета директоров Общества могут быть прекращены в любое время по решению Общего собрания Участников Общества, принятому большинством голосов Участников Общества.
0.7. Члены Совета директоров избирают из своего состава Председателя Совета директоров.
Члены Совета директоров вправе в любое время переизбрать председателя Совета директоров.
0.8. Генеральный директор Общества не может быть одновременно Председателем Совета директоров Общества.
0.9. Председатель Совета директоров:
•организует работу Совета директоров;
•созывает заседания Совета директоров;
•осуществляет функции председательствующего на заседаниях Совета директоров;
•организует ведение протоколов заседаний Совета директоров;
•осуществляет иные полномочия, отнесенные к его ведению настоящим Уставом и внутренними документами Общества.
0.10.  В случае временного отсутствия Председателя Совета директоров его функции осуществляет один из членов Совета директоров Общества по решению Совета директоров.
10.11. Решения Совета директоров Общества могут приниматься на очных заседаниях и заочным голосованием (опросным путем).
10.12. Заседания Совета директоров Общества созываются Председателем Совета директоров Общества по его собственной инициативе, а также по требованию члена Совета директоров, аудитора Общества, Генерального директора Общества, иных лиц, определенных настоящим Уставом. 
10.13. Кворум для проведения заседания (заочного голосования) Совета директоров Общества составляет не менее половины от числа членов Совета директоров Общества. При определении наличия кворума и результатов голосования на заседании Совета директоров Общества учитывается письменное мнение члена Совета директоров Общества, отсутствующего на заседании Совета директоров Общества. Член Совета директоров Общества также считается присутствующим на заседании, если он участвует в заседании по селекторной связи или иным способом может оперативно в процессе заседания высказывать свое мнение и голосовать по обсуждаемым вопросам.
При проведении заочного голосования принявшими участие в голосовании считаются члены Совета директоров, представившие к дате голосования свою позицию по проекту решения («за», или «против», или «воздержался») в письменной форме, в том числе по факсу или в форме электронного сообщения. 
10.14. Решения на заседании (заочном голосовании) Совета директоров принимаются большинством голосов членов Совета директоров, принимающих участие в заседании (заочном голосовании) и (или) выразивших свое мнение письменно.
В случае равенства голосов членов Совета директоров Общества голос Председателя Совета директоров Общества является решающим для принятия Советом директоров Общества решения.
10.15. Решения Совета директоров Общества оформляются протоколами, которые подписываются Председателем Совета директоров (председательствующим на заседании).
10.16. В случае если общим собранием Участников не принято решение об избрании Совета директоров Общества функции Совета директоров Общества осуществляет Общее собрание Участников, в том числе принимает решения по вопросам, отнесенным Законом и настоящим Уставом к компетенции Совета директоров Общества, при этом решение вопросов, связанных с подготовкой, созывом и проведением Общего собрания участников, относится к компетенции единоличного исполнительного органа Общества.

СТАТЬЯ 11. ИСПОЛНИТЕЛЬНЫЙ ОРГАН ОБЩЕСТВА.
0.1. Единоличным исполнительным органом Общества является Генеральный директор. Генеральный директор Общества избирается Советом директоров Общества сроком на 3 (три) года. Полномочия Генерального директора могут быть досрочно прекращены по решению Совета директоров Общества.
0.2. Трудовой договор между Обществом и Генеральным директором подписывается от имени Общества председателем Совета директоров или лицом, уполномоченным Советом директоров. 
0.3. К компетенции Генерального директора относятся все вопросы руководства текущей деятельностью Общества, за исключением вопросов, отнесенных действующим законодательством и настоящим Уставом к компетенции Общего собрания Участников или Совета директоров Общества.
Генеральный директор Общества:
1) организует выполнение решений Общего собрания участников и Совета директоров;
2) без доверенности действует от имени Общества, в том числе:
представляет его интересы, совершает сделки, утверждает штаты, издает приказы, распоряжения и в пределах своей компетенции дает указания, обязательные для исполнения всеми работниками Общества, определяет условия оплаты труда работников Общества, его представительств, филиалов и иных обособленных подразделений, а также издает приказы о назначении работников, их переводе и увольнении, применяет меры поощрения и налагает дисциплинарные взыскания, 
  при условии, что:
- сделки и иные действия, решение о совершении которых в соответствии с действующим законодательством и настоящим Уставом должно приниматься Общим собранием Участников или Советом директоров Общества, могут заключаться (совершаться) Генеральным директором только при наличии и в соответствии с таким решением, соответственно, Общего собрания Участников или Совета директоров Общества;
- назначение на должности, которые в соответствии с настоящим Уставом должны быть предварительно согласованы с Советом директоров Общества, могут производиться Генеральным директором только при наличии соответствующего решения Совета директоров Общества;
3) утверждает внутренние документы, регламентирующие текущую деятельность и порядок оперативного управления Обществом, обеспечивает контроль их исполнения, подписывает все документы от имени Общества;
4) определяет организационную структуру Общества;
5) направляет уведомления кредиторам Общества в случае реорганизации или ликвидации Общества, предстоящего уменьшения Уставного капитала Общества и в иных определенных законодательством случаях;
6) выдает доверенности, предоставляющие полномочия действовать от имени Общества по вопросам, не выходящим за пределы компетенции Генерального директора;
7) решает вопросы, связанные с подготовкой, созывом и проведением Общего собрания Участников Общества;
8) в рамках своей компетенции решает вопросы развития Общества и его деятельности;
9) исполняет другие функции, возложенные на него Законом, Общим собранием Участников, Советом директоров, а также настоящим Уставом.
Генеральный директор обязан информировать контрагентов Общества о существующих ограничениях его полномочий в отношении заключения сделок, установленных настоящим Уставом.
0.4. Общество вправе передать по договору полномочия своего единоличного исполнительного органа управляющей организации (управляющему). 
11.5. Если деятельность Общества связана с работой со сведениями, составляющими государственную тайну, на должность Генерального директора назначается лицо, имеющее соответствующую форму допуска к государственной тайне и необходимую подготовку, предусмотренную действующим законодательством, по организации работ по защите государственной тайны в Обществе.
11.6. Генеральный директор несет персональную ответственность за организацию работ, задач по защите и сохранению государственной тайны. Принимает решение о допуске (отказе), либо прекращении допуска должностных лиц и граждан к государственной тайне и условиях заключения с этими лицами трудовых договоров.
 11.7. Генеральный директор Общества, равно как и управляющая организация (управляющий), как и иные лица, которым предоставлены полномочия единоличного исполнительного органа, при осуществлении своих полномочий должны действовать в интересах Общества, осуществлять свои права и исполнять обязанности в отношении Общества добросовестно и разумно. Вышеуказанные лица несут ответственность за убытки, причиненные Обществу их виновными действиями (бездействием), а также по иным основаниям установленным законодательством.

СТАТЬЯ 12. ВЕДЕНИЕ СПИСКА УЧАСТНИКОВ ОБЩЕСТВА ХРАНЕНИЕ ДОКУМЕНТОВ ОБЩЕСТВА. ПРЕДОСТАВЛЕНИЕ ИНФОРМАЦИИ.
0.1. Генеральный директор Общества отвечает за хранение документов Общества, предоставление их и соответствующих выписок Участникам Общества по запросу, а также заверение необходимых копий таких документов.
0.2. Общество обязано хранить следующие документы:
•Протоколы, решения, договоры и иные документы, связанные с учреждением Общества, Устав Общества, а также внесенные в Устав Общества и зарегистрированные в установленном порядке изменения;
•документ, подтверждающий государственную регистрацию Общества;
•документы, подтверждающие права Общества на имущество, находящееся на его балансе;
•внутренние документы Общества;
•положения о филиалах и представительствах Общества;
•документы, связанные с эмиссией облигаций и иных эмиссионных ценных бумаг Общества;
•протоколы Общих собраний Участников Общества, заседаний Совета директоров Общества;
•списки аффилированных лиц Общества;
•заключения аудитора, государственных и муниципальных органов финансового контроля;
•иные документы, предусмотренные федеральными законами и иными правовыми актами Российской Федерации, внутренними документами Общества, решениями Общего собрания Участников, Совета директоров и Генерального директора Общества. 
0.3. Любой Участник имеет право запросить и получить копию Устава Общества (с учетом изменений к нему), а также копии или выписки из протоколов Общего собрания Участников и заседаний Совета директоров Общества. Плата, взимаемая Обществом за подготовку таких копий, не может превышать фактической стоимости изготовления таких копий и выписок.
0.4.  Каждый Участник вправе за свой счет изучать документы бухгалтерского учета и отчетности Общества, а также получать иную информацию, включая ежемесячные управленческие отчеты, производственные статистические данные и иную финансовую информацию, в той форме, в которой Участник может обоснованно потребовать ее.
0.5.  При реорганизации Общества сведения, составляющие государственную тайну, и их носители подлежат передаче правопреемнику Общества, если этот правопреемник имеет полномочия по проведению работ с использованием сведений, составляющих государственную тайну. В противном случае указанные сведения и их носители подлежат в установленном порядке сдаче на архивное хранение, или уничтожению, или передаются органу, в распоряжение которого в соответствии со статьей 9 Закона «О государственной тайне» находятся соответствующие сведения.
12.6. При ликвидации Общества сведения, составляющие государственную тайну, и их носители подлежат в установленном порядке сдаче на архивное хранение, или уничтожению, или передаются органу, в распоряжении которого в соответствии с Федеральным законом «О государственной тайне» находятся соответствующие сведения.
12.7. Общество ведет список Участников Общества с указанием сведений о каждом Участнике Общества, размере его доли в уставном капитале Общества и ее оплате, а также о размере долей, принадлежащих Обществу, датах их перехода к Обществу или приобретения Обществом.
 12.8. Генеральный директор Общества обеспечивает соответствие сведений, указанных в списке Участников Общества сведениям, содержащимся в едином государственном реестре юридических лиц, и нотариально удостоверенным и иным сделкам по переходу долей в уставном капитале Общества, о которых стало известно Обществу.
 12.9. Каждый Участник Общества обязан информировать своевременно Общество об изменении сведений о своем имени или наименовании, месте жительства или месте нахождения, а также сведений о принадлежащих ему долях в уставном капитале Общества.

СТАТЬЯ 13. ЗАКЛЮЧИТЕЛЬНЫЕ ПОЛОЖЕНИЯ.
13.1. Настоящий Устав, а также все изменения и дополнения к нему, приобретают силу для третьих лиц с момента их государственной регистрации, а в установленных действующим законодательством случаях - с момента уведомления регистрирующего органа.
13.2. Участники и органы Общества обязаны руководствоваться настоящим Уставом и всеми изменениями и дополнениями к нему с момента их утверждения Общим собранием Участников Общества, а в установленных действующим законодательством случаях - Советом директоров Общества.
13.3. В случае противоречия положений настоящего Устава действующему законодательству Общество, его органы и Участники Общества руководствуются положениями действующего законодательства.
13.4. Недействительность любого положения настоящего Устава не влечет недействительности остальных его положений. В случае вступления в силу новых нормативных актов, в соответствии с которыми отдельные положения настоящего Устава становятся недействительными, и которые требуют внести изменения в Устав, Участники обязаны принять решения о внесении соответствующих изменений в настоящий Устав.

