0.1.  Общество является юридическим лицом согласно законодательству.
0.2.  Общество осуществляет свою деятельность в соответствии с действующим законодательством, а также в соответствии с настоящим Уставом, решениями органов управления Общества, принятыми в пределах их компетенции в порядке, предусмотренном законодательством и настоящим Уставом. 
0.3.  Общество является дочерним обществом ПАО «Газпром нефть» (ОГРН 1025501701686). ПАО «Газпром нефть» вправе давать Обществу указания и/или согласие на заключение сделок.
0.4.  Общество имеет в собственности обособленное имущество, учитываемое на его самостоятельном балансе, может от своего имени приобретать и осуществлять имущественные и личные неимущественные права, нести обязанности. В гражданском обороте Общество выступает от своего собственного имени.
0.5.  Общество имеет круглую печать, содержащую полное фирменное наименование на русском языке и указание на место нахождения Общества. Общество вправе иметь штампы и бланки со своим фирменным наименованием, а также зарегистрированные в установленном порядке  товарные знаки и знаки обслуживания.
0.6.  Общество может выступать истцом, ответчиком и третьим лицом в судах общей юрисдикции, арбитражных и третейских судах.
0.7.  Общество несет ответственность по своим обязательствам всем принадлежащим ему имуществом.
0.8.  Общество не несет ответственности по обязательствам участников Общества (далее – «Участники»).
0.9.  Участники Общества не отвечают по  обязательствам Общества, за исключением случаев, предусмотренных законодательством. 
0.10.  Общество создается и действует в целях извлечения прибыли посредством осуществления предпринимательской деятельности.
0.11.  Основными видами деятельности Общества являются:
