5) принятие решений о совершении сделок (в том числе нескольких взаимосвязанных сделок) на сумму, превышающую 50 000 000 (пятьдесят миллионов) рублей (или эквивалент указанной суммы в любой другой валюте), и сделок (в том числе нескольких взаимосвязанных сделок) с имуществом Общества, стоимость которого на основании данных бухгалтерской отчетности Общества за последний отчетный период, предшествующий дню принятия решения о совершении таких сделок, превышает 50 000 000 (пятьдесят миллионов) рублей (или эквивалент указанной суммы в любой другой валюте), за исключением сделок, совершаемых в процессе обычной хозяйственной деятельности Общества, а также, за исключением сделок с ПАО «Газпром нефть» и обществами, входящими в группу лиц с ним;
6) принятие решений о совершении сделок, связанных с получением или предоставлением Обществом займов, кредитов (в том числе вексельных), предоставлением гарантий и поручительств по обязательствам Общества и(или) третьих лиц, за исключением сделок с ПАО «Газпром нефть» и обществами, входящими в группу лиц с ним;
