2.2 Общая стоимость Услуг составляет пятьдесят девять миллионов четыреста девяносто девять тысяч восемьсот (59 499 800) рублей ноль (00) копеек, включая НДС (20%): Девять миллионов десятьсот шестнадцатб тысяч шестьсот тридцать три (9 916 633) рубля тридцать три (33) копейки. Стоимость Услуг является фиксированной (твердой) и не подлежит изменению в течение срока действия Договора.
