 - согласие на обработку персональных данных главного бухгалтера, генерального директора с копиями паспортов.
3.2.17 В случае привлечения Исполнителем для оказания Услуг субподрядчиков, Исполнитель доводит до их сведения все обязательных требования данного Договора, обеспечивает контроль за соблюдением субподрядчиками требований нормативных документов и условий данного Договора. 
3.2.18 Исполнитель гарантирует наличие у привлекаемых субподрядчиков всех разрешений и лицензий, необходимых для оказания Услуг по настоящему Договору, а также свидетельств о допуске к определенному виду или видами работ, которые необходимы при исполнении Договора, и несет ответственность за полноту и качество выполняемых субподрядчиками Услуг по настоящему Договору. 
