3.2.21 В целях обеспечения контроля за исполнением настоящего Договора, требования настоящей статьи подлежат обязательному включению во все договоры, заключаемые Исполнителем с субподрядчиком, и во все последующие договоры, заключаемые такими субподрядчиками с его контрагентами;
3.2.22 выполнять обязательство по соблюдению применимого законодательства в сфере противодействия мошенничеству и коррупции, предусмотренное Приложением № 4 к Договору;
3.2.23 Исполнитель на основании письменного запроса Заказчика представляет последнему указанные в запросе документы, подтверждающие расходы, фактически понесенные Исполнителем при оказании услуг по Договору, в срок, установленный в таком запросе, но в любом случае, не позднее 10 календарных дней с момента получения запроса.
3.2.24 Исполнитель обязуется включать условия пунктов 3.2.22, 7.11 Договора в договоры с субподрядчиками/третьими лицами, заключаемые в связи с исполнением настоящего Договора.
3.2.25 нести иные обязанности, предусмотренные условиями настоящего Договора.
