3.3.7 осуществлять иные права, предусмотренные Договором или действующим законодательством Российской Федерации.
3.5 Заказчик обязуется:
3.4.2 своевременно принять и оплатить надлежаще оказанные Услуги в соответствии с условиями Договора;
