5.2 Одновременно с передачей результатов Услуг по Договору (Отчетных материалов) Исполнитель с момента подписания Сторонами Акта сдачи-приемки оказанных Услуг передает в полном объеме (отчуждает) Заказчику все исключительные права на все результаты Услуг по Договору.
