5.7 В случае привлечения, с предварительного письменного согласия Заказчика, субподрядных организаций Исполнитель обязуется включать в договоры между Исполнителем и субподрядными организациями условия о передаче Исполнителю всех исключительных прав на результаты Услуг по Договору для последующей передачи таких прав Заказчику.
5.8 Если в течение срока действия Договора или в любое время после его окончания Заказчику со стороны третьих лиц будут предъявлены какие-либо претензии, связанные с нарушением прав третьих лиц на результаты интеллектуальной деятельности, включая Отчетные материалы (их составные части, а также иные результаты оказанных Услуг), Исполнитель обязуется в полном объеме возместить убытки третьей стороне (либо компенсировать соответствующие расходы Заказчика) в порядке, предусмотренном действующим законодательством Российской Федерации.
