• Отчетные материалы будут созданы в рамках выполнения служебных обязанностей или служебного задания лицами (авторами), которые состоят в трудовых отношениях с Исполнителем (или третьими лицами, привлекаемыми Исполнителем) и в силу должностных обязанностей данные лица (авторы) не смогут предъявлять каких-либо претензий и исков, вытекающих из прав на результаты Услуг (включая Отчетные материалы).
6.4 Заверения об обстоятельствах имеют существенное значение для Сторон.
