7.2 В случае если Исполнитель не выполнит свои обязательства по Договору в срок, определенный в Техническом задании, и/ или нарушит срок устранения недостатков в Отчетных материалах, и/или сроки, установленные п. 3.2.7 Договора, Заказчик вправе потребовать от Исполнителя выплаты неустойки в размере 0,3% (ноль целых три десятых процента) от общей стоимости Услуг за каждый начавшийся день просрочки.
7.3 В случае, если Заказчик задерживает любые выплаты, установленные Договором, на срок более чем 15 (пятнадцать) дней без уважительной причины, Исполнитель вправе взыскать с Заказчика неустойку в размере 0,3% (ноль целых одна сотая процента) от стоимости неоплаченных Услуг за каждый начавшийся день просрочки.
