 В случае нарушения заверений, приведенных в п. 6.2 Договора, Исполнитель дополнительно обязан выплатить Заказчику в качестве штрафа твердую денежную сумму в размере 50 000 (пятьдесят тысяч) рублей за каждый случай нарушения.
