7.9 Возмещение убытков и (или) уплата неустойки в случае неисполнения обязательств или ненадлежащего исполнения обязательств не освобождают Стороны от исполнения обязательств в натуре.
7.10 Исполнитель обязан также возместить Заказчику потери, равные сумме штрафов и иных выплат (в том числе, платежей, сборов, такс, тарифов, сумм ущерба), наложенных надзорными органами на (или взысканных с) Заказчика за действия Исполнителя на территории Заказчика. 
7.11 В случае выявления недостоверных (несоответствующих действительности) сведений в документах, предоставленных Исполнителем (за исключением опечаток, грамматических ошибок), Заказчик вправе потребовать, а Исполнитель обязан уплатить Заказчику штраф в размере 2% за каждый выявленный случай от общей цены договора.
7.12 За несвоевременное представление запрошенных в соответствии с пунктом 3.2.22 Договора документов Исполнитель уплачивает Заказчику пени в размере 0,1 % от общей суммы Договора за каждый непредставленный вовремя документ за каждый день просрочки.
