• Договор заключен добровольно при равенстве переговорных позиций Сторон, Стороны имели равные возможности при согласовании и определении условий настоящего Договора, а также что Договор не содержит каких-либо обременительных для них условий, с которыми Стороны не согласны;
• Договор является неделимым соглашением Сторон по предмету Договора и отменяет все предыдущие договорённости, предложения, обязательства, письменные, устные заявления, толкования любого рода.
6.3 Исполнитель заверяет Заказчика, что:
• обладает всеми необходимыми возможностями и ресурсами, лицензиями и разрешениями для выполнения обязательств, предусмотренных Договором, и у него отсутствуют какие-либо ограничения для исполнения Договора;
• обладает достаточными для оказания Услуг по Договору правами на все результаты интеллектуальной деятельности, используемые Исполнителем при оказании Услуг (за исключением материалов, предоставленных Заказчиком);
• Отчетные материалы будут созданы в рамках выполнения служебных обязанностей или служебного задания лицами (авторами), которые состоят в трудовых отношениях с Исполнителем (или третьими лицами, привлекаемыми Исполнителем) и в силу должностных обязанностей данные лица (авторы) не смогут предъявлять каких-либо претензий и исков, вытекающих из прав на результаты Услуг (включая Отчетные материалы).
6.4 Заверения об обстоятельствах имеют существенное значение для Сторон.
9 ОТВЕТСТВЕННОСТЬ СТОРОН.
7.2 В случае если Исполнитель не выполнит свои обязательства по Договору в срок, определенный в Техническом задании, и/ или нарушит срок устранения недостатков в Отчетных материалах, и/или сроки, установленные пункт 3.2.7 Договора, Заказчик вправе потребовать от Исполнителя выплаты неустойки в размере 0,3% (ноль целых три десятых процента) от общей стоимости Услуг за каждый начавшийся день просрочки.
7.3 В случае, если Заказчик задерживает любые выплаты, установленные Договором, на срок более чем 15 (пятнадцать) дней без уважительной причины, Исполнитель вправе взыскать с Заказчика неустойку в размере 0,3% (ноль целых одна сотая процента) от стоимости неоплаченных Услуг за каждый начавшийся день просрочки.
7.4 Общая сумма всех сумм неустоек, подлежащих уплате Исполнителю, не должна превышать 10% (десяти процентов) от общей стоимости Услуг.
7.5 В случае если любое из заверений об обстоятельствах, изложенное в статье 6 Договора, окажется ложным, либо будет нарушено, виновная Сторона обязуется возместить другой Стороне убытки, причиненные недостоверностью и/или нарушением таких заверений, включая любые связанные издержки (в том числе разумные судебные издержки) и расходы.
 В случае нарушения заверений, приведенных в пункт 6.2 Договора, Исполнитель дополнительно обязан выплатить Заказчику в качестве штрафа твердую денежную сумму в размере 50000 (пятьдесят тысяч) рублей за каждый случай нарушения.
7.6 В случае нарушения Исполнителем обязанности, предусмотренной пункт 3.2.13 Договора, Заказчик вправе на основании письменного требования взыскать с Исполнителя неустойку в размере 50000 (пятьдесят тысяч) рублей за каждый случай нарушения.
7.7 Стороны несут и иную ответственность, предусмотренную действующим законодательством Российской Федерации.
7.8 Убытки, понесенные любой из Сторон по Договору и подлежащие возмещению другой Стороной, ограничиваются реальным ущербом, и взыскиваются в полном объеме сверх неустойки.
7.9 Возмещение убытков и (или) уплата неустойки в случае неисполнения обязательств или ненадлежащего исполнения обязательств не освобождают Стороны от исполнения обязательств в натуре.
7.10 Исполнитель обязан также возместить Заказчику потери, равные сумме штрафов и иных выплат (в том числе, платежей, сборов, такс, тарифов, сумм ущерба), наложенных надзорными органами на (или взысканных с) Заказчика за действия Исполнителя на территории Заказчика. 
7.11 В случае выявления недостоверных (несоответствующих действительности) сведений в документах, предоставленных Исполнителем (за исключением опечаток, грамматических ошибок), Заказчик вправе потребовать, а Исполнитель обязан уплатить Заказчику штраф в размере 2% за каждый выявленный случай от общей цены договора.
7.12 За несвоевременное представление запрошенных в соответствии с пунктом 3.2.22 Договора документов Исполнитель уплачивает Заказчику пени в размере 0,1 % от общей суммы Договора за каждый непредставленный вовремя документ за каждый день просрочки.
7.13 Исполнитель несет ответственность за соблюдение сроков предоставления корректно оформленных копий/оригиналов актов сдачи-приемки оказанных услуг, счета-фактуры (если применимо) и отчетных материалов (при наличии), предусмотренных в настоящем (Договоре). В случае выявленного нарушения Исполнитель обязан уплатить Заказчику штраф в размере 2 (двух) % (процентов) от выставленных с нарушением сроков объемов Услуг. Указанный штраф также применяется к Исполнителю в случае представления копий/оригиналов акта сдачи-приемки оказанных услуг, счета-фактуры и отчетных материалов (при наличии) в отчетном периоде, не соответствующем фактическому периоду оказания Услуг.
10 ОБСТОЯТЕЛЬСТВА НЕПРЕОДОЛИМОЙ СИЛЫ.
8.2 Стороны освобождаются от ответственности за неисполнение или ненадлежащее исполнение обязательств по Договору в случае возникновения обстоятельств непреодолимой силы, к которым относятся события, на которые Стороны не могут оказывать влияния и за возникновение которых не несут ответственности, например, землетрясение, наводнение, пожар, а также военные действия любого характера, препятствующие выполнению предмета данного Договора.
8.3 Сторона, которая не в состоянии выполнить свои обязательства по Договору в силу возникновения обстоятельств непреодолимой силы, обязана в течение 3 (трех) дней информировать другую Сторону о наступлении таких обстоятельств в письменной форме и сообщить данные о характере обстоятельств, дать оценку их влияния на исполнение и возможный срок исполнения обязательств по Договору.
8.4 Не извещение и/или несвоевременное извещение другой Стороны согласно пункт 8.2 Договора влечет за собой утрату Стороной права ссылаться на эти обстоятельства.
8.5 Подтверждением наличия и продолжительности действия обстоятельств непреодолимой силы будут являться документальные подтверждения, выданные Торгово-промышленной палатой или компетентным органом исполнительной власти (органом местного самоуправления), расположенными по месту возникновения/существования обстоятельств непреодолимой силы.
8.6 Если подобные обстоятельства продлятся более 30 (тридцати) дней, то любая из Сторон вправе расторгнуть Договор в одностороннем порядке, известив об этом другую Сторону не менее чем за 5 (пять) дней до даты предполагаемого расторжения.
11 ПОРЯДОК РАЗРЕШЕНИЯ СПОРОВ.
9.2 Вопросы толкования, действительности, исполнения и прекращения настоящего Договора, а также иные вопросы, связанные с настоящим Договором или вытекающие из него, регулируются материальным правом Российской Федерации.
9.3 Все споры и разногласия, которые могут возникнуть между Сторонами в связи с настоящим Договором, будут регулироваться путем переговоров с применением претензионного порядка. Срок для ответа на претензии устанавливается в 15 (пятнадцать) календарных дней. При этом срок ответа на претензии исчисляется со дня, следующего за датой поступления претензий.
9.4 Все неурегулированные в претензионном порядке споры, разногласия или требования, возникающие из Договора или в связи с ним, в том числе касающиеся его исполнения, нарушения, прекращения или недействительности, подлежат разрешению в Арбитражном суде города Санкт-Петербурга и Ленинградской области в соответствии с действующим законодательством Российской Федерации.
9.5 Никакое согласие или отказ, явно выраженные или предполагаемые какой-либо из Сторон Договора по поводу нарушения или невыполнения обязательств другой Стороной, не должны считаться или толковаться как согласие или отказ в отношении нарушения или невыполнения такой Стороной каких-либо иных предусмотренных обязательств.
9.6 Непредъявление любой из Сторон претензии по поводу каких-либо мер или непринятие каких-либо мер другой Стороной или отсутствие заявления о невыполнении обязательств другой Стороной, не может служить основанием для отказа от реализации прав такой Стороны. Отказ Стороны от реализации права должен быть явно выражен в письменной форме и не распространяется на реализацию аналогичных прав в будущем.
12 СРОК ДЕЙСТВИЯ ДОГОВОРА.
12.2 Договор вступает в силу с даты его подписания обеими Сторонами и действует до полного исполнения Сторонами обязательств по Договору.
12.3 Положения Договора о зачете задолженности (п. 2.8 Договора), о конфиденциальности (п. п. 3.2.10, 10.1 Договора), об интеллектуальной собственности (п. п. 5.1-5.7 Договора), о заверениях об обстоятельствах (п. п. 6.1-6.3 Договора), об ответственности (п. п. 7.1-7.10 Договора), о применимом праве и разрешении споров (п. п. 9.1-9.5 Договора), об уведомлениях (п. п. 11.1-11.4 Договора), об уступке прав (п. 13.3 Договора) действуют в течение 3 (трех) лет после прекращения Договора.
12.4 Договор может быть расторгнут по взаимному согласию Сторон.
12.5 Заказчик вправе в одностороннем внесудебном порядке отказаться от исполнения Договора в случае неисполнения Исполнителем обязанности, предусмотренной пункт 3.2.12 Договора. В этом случае Договор считается расторгнутым с даты получения Исполнителем письменного Уведомления Заказчика об отказе от исполнения Договора или с иной даты, указанной в таком Уведомлении.
12.6 Заказчик вправе в любое время в одностороннем внесудебном порядке отказаться от исполнения Договора, без указания причин направив соответствующее письменное Уведомление Исполнителю. В этом случае Договор считается расторгнутым с даты, указанной в таком Уведомлении.
 При этом Заказчик обязан уплатить Исполнителю часть установленной стоимости пропорционально части Услуг, принятых до уведомления об отказе от исполнения Договора, и возместить Исполнителю обоснованные расходы, фактически понесенные до этого момента в целях исполнения Договора, если они не входят в указанную часть стоимости Услуг. При этом размер подлежащих возмещению расходов не может превышать разницу между общей стоимостью Договора и оплаченной Заказчиком частью стоимости Договора. При отказе Заказчика от Договора в случаях, предусмотренных п. п. 3.3.4, 3.3.5 Договора Заказчик не возмещает Исполнителю расходы, а все ранее оплаченные Исполнителю по Договору суммы подлежат возврату Исполнителем Заказчику.
13 ПРОЧИЕ УСЛОВИЯ.
13.2 Если отдельные положения Договора являются или будут признаны недействительными или утратившими силу, то это не влияет на действительность прочих положений, если иное разумно не вытекает из содержания Договора или не предусмотрено законодательством Российской Федерации.
13.3 Все изменения, дополнения и приложения к Договору, совершенные в письменной форме и подписанные надлежащим образом уполномоченными представителями обеих Сторон, являются его составной и неотъемлемой частью.
13.4 Сторона вправе уступить свои права по Договору исключительно после получения предварительного письменного согласия другой Стороны. За нарушения положений настоящего пункта нарушившая Сторона обязана уплатить другой Стороне неустойку в размере 200000 (двести тысяч) рублей, а также возместить в полном объеме сверх неустойки убытки, понесенные другой Стороной.
13.5 Полномочия представителей Заказчика, подтвержденные документами, совершенными в простой письменной форме, будут считаться подтвержденными надлежащим образом. Исполнитель обязан исполнить обязательство по настоящему Договору такому представителю.
13.6 Договор составлен в двух идентичных по содержанию экземплярах, каждый из которых является оригиналом; по одному экземпляру передается каждой из Сторон.

 К Договору прилагаются и являются его неотъемлемой частью:
• Приложение № 1 

 Техническое задание на оказание Услуг;



• Приложение № 2 

 Форма Акта сдачи-приемки оказанных Услуг;



• Приложение № 3 

 Форма Акта приема-передачи документов;



• Приложение № 4 

 Обязательство по соблюдению применимого законодательства в сфере противодействия мошенничеству и коррупции. 



14 АДРЕСА И РЕКВИЗИТЫ СТОРОН.

