3.2 Исполнитель вправе:
3.1.2 привлекать третьих лиц с целью обеспечения надлежащего, эффективного и качественного предоставления Услуг с предварительного письменного согласия Заказчика и при условии наличия у них лицензии и иных разрешений, необходимых для оказания соответствующих услуг в соответствии с требованиями законодательства РФ. Исполнитель во всех случаях несет перед Заказчиком ответственность за неисполнение или ненадлежащее исполнение обязательств этими третьими лицами как за свои собственные действия;
3.1.3 запрашивать у Заказчика необходимые для надлежащего оказания Услуг по Договору информацию и документы, предусмотренные в Техническом задании;
3.1.4 осуществлять иные права, предусмотренные Договором или действующим законодательством Российской Федерации.
3.3 Исполнитель обязуется:
3.2.2 добросовестно, действуя в интересах Заказчика, оказывать Услуги в объеме и в сроки, а также в соответствии с требованиями, определенными Сторонами в Договоре (в том числе в Техническом задании);
3.2.3 предварительно согласовывать результаты оказания Услуг (Отчетные материалы), а именно проект экспертного заключения, с Заказчиком, а при необходимости – вместе с Заказчиком с иными организациями;
3.2.4 при обнаружении недостатков в Отчетных материалах, а также в случае отступления Исполнителя от Технического задания, Исполнитель по требованию Заказчика, за свой счет, устраняет указанные недостатки в течение 10 (десяти) рабочих дней, если иной срок не согласован Сторонами;
3.2.5 назначить Менеджера Проекта для организации процесса оказания Услуг в объеме, предусмотренном Договором и Техническим заданием, на протяжении всего периода оказания Услуг и письменно уведомить об этом Заказчика. По требованию Заказчика Менеджер Проекта Исполнителя должен быть сменен на иного Менеджера в срок, не превышающий 3 (трех) рабочих дней;
3.2.6 в ходе оказания Услуг согласовывать с Заказчиком необходимость использования результатов интеллектуальной деятельности, которым предоставляется правовая охрана, принадлежащих Исполнителю или третьим лицам, а также приобретение Заказчиком прав на использование таких результатов, принадлежащих Исполнителю или третьим лицам;
3.2.7 своими силами и за свой счет получить до начала оказания Услуг и поддерживать в силе в течение всего срока выполнения Услуг по настоящему Договору лицензии, сертификаты и разрешения государственных органов, которые необходимы Исполнителю для выполнения своих обязательств по Договору; 
3.2.8 письменно уведомить Заказчика о прекращении (приостановлении и т.п.) необходимых разрешений, согласований, сертификатов, лицензий и/или членства в СРО в срок не позднее 3 (трех) рабочих дней до даты истечения срока их действия или в течение 3 (трех) рабочих дней с момента их досрочного прекращения (приостановления и т.п.); В случае получения отказа Заказчика от Договора в соответствии с п.п. 3.3.4, 3.3.5 Договора в течение 3 (трех) рабочих дней с момента получения требования Заказчика вернуть все суммы, полученные по Договору от Заказчика и возместить причиненные Заказчику убытки.
3.2.9 информировать Заказчика о ходе выполнения Услуг не позднее 3 (трех) рабочих дней с момента получения соответствующего запроса от Заказчика;
